int fseq_sizetf()
{
    return(8);
}

int fseq_calltf()
{
// 		$func_phaseerrors(input_angles,phase_acum_mod, phi_error, val_engle);
	int phi_error, val_engle;
	get_table_value(tf_getp(1), &phi_error, &val_engle);
    
	tf_putp(2, phi_error);
	tf_putp(3, val_engle);
    return(0);
}


int fseq_checktf()
{
    bool err = FALSE;
    if (tf_nump() != 3) {
        tf_error("For work this function I need 3 arguments!!!!.\n");
        err = TRUE;
    }
    if (tf_typep(1) == tf_nullparam) {
        tf_error("Memory can't a NULL argument.\n");
        err = TRUE;
    }
   // if (tf_sizep(1) > 16) {
   //     tf_error("I have made memory only for values not more integer=16bit.\n");
   //     err = TRUE;
   // }
    if (err) {
        tf_message(ERR_ERROR, "", "", "");
    }
    return(0);
}


int get_table_value(int pos, int *phi_error, int *val_engle)
{
 *phi_error=ph_errs[pos&0x3FFFF][1];
 *val_engle=ph_errs[pos&0x3FFFF][0];
 return 0;
}


